import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on the "Messages" navigation button using a specific class selector
    await page.waitForSelector("button.nav-item.messages-btn", { timeout: 5000 });
    await page.click("button.nav-item.messages-btn");
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_messages_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_messages_clicked.png'));

    // 2. Click the "See all" button in suggestions using a text-based selector
    await page.waitForSelector("button.see-all-btn", { timeout: 5000 });
    await page.getByRole('button', { name: 'See all' }).click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_see_all_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_see_all_clicked.png'));

    // 3. Click the first "like" button on a post
    await page.waitForSelector("button.action-btn.like-btn", { timeout: 5000 });
    await page.locator('button.action-btn.like-btn').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_like_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_like_clicked.png'));

    // 4. Type into the main search input field using an ID selector
    await page.waitForSelector("#mainSearchInput", { timeout: 5000 });
    await page.type("#mainSearchInput", "Automated Search Query");
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_search_filled.png'));

    // 5. Click the "Your story" button
    await page.waitForSelector("button.story.add-story", { timeout: 5000 });
    await page.locator('button.story.add-story').click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_story_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_story_clicked.png'));

    // 6. Extract data to verify
    const searchInputValue = await page.inputValue('#mainSearchInput');
    const postUsername = await page.textContent('article.post .post-username');

    return {
      success: true,
      action: "Clicked nav buttons, liked a post, entered a search query, and clicked a story button.",
      extractedData: {
        searchQuery: searchInputValue,
        firstPostUsername: postUsername.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
